import React from "react";
import "../styles/Footer.css";
export default function Footer() {
  return (
    <footer className="footer py-2 ">
      <div className="container-footer">
        <div className="row">
          <div className="col-md-6 pl-5 pt-2">
            <p>&copy; 2023 MITIT</p>
          </div>
        </div>
      </div>
    </footer>
  );
}
